import React from 'react';
import UsersList from './components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: '1',
      image: 'https://randomuser.me/',
      name: 'John Doe',
      placeCount: 3,
    },  {
      id: '2',
      image: 'https://randomuser.me/',
      name: 'John Doe',
      placeCount: 4,
    }
  ];

  return (
    <UsersList
      key={USERS.id}
      Item={USERS.id}
      image={USERS.image}
      name={USERS.name}
      placeCount={USERS.placeCount}
    />
  );
};

export default Users;
